// import React component
import React, { Component } from "react";

function Tr(props){

    return (
        <tr>
            <td>{props.first_name}</td>
            <td>{props.last_name}</td>
            <td>{props.role}</td>
            <td>{props.salary}</td>
            <td>{props.department}</td>
        </tr>
    );

}

export default Tr;
